import React from "react";
import "../App.css";
import "../css/Skills.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  IconLookup,
  IconDefinition,
  findIconDefinition
} from "@fortawesome/fontawesome-svg-core";

const coffeeLookup: IconLookup = { prefix: "fas", iconName: "coffee" };
const coffeeIconDefinition: IconDefinition = findIconDefinition(coffeeLookup);

const skillsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Skills() {
  const skillsStyle = skillsStyles();

  return (
    <div id="skills">
      <div>
        <p className="menu-name">SKILLS</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>
            <FontAwesomeIcon icon={coffeeIconDefinition} />
          </Paper>
        </Grid>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>도전</Paper>
        </Grid>
        <Grid item xs={6} sm={3} md={2}>
          <Paper className={skillsStyle.icon}>협력</Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Skills;
